import React from 'react';
import { Row, Col } from 'react-bootstrap';
import { Icon } from '../../common/Icon.jsx';
import logo from './logo-brand.png'; // Tell Webpack this JS file uses this image


export const Header = () => {
    return (
        <Row className="header">
            <Col sm={2} xs={2}>
                <Icon iconName="chevron-left" />
            </Col>
            <Col sm={1} xs={1}>
                <Icon iconName="home" />
            </Col>
            <Col sm={7} xs={7} style={{ textAlign: "center" }}>
                <img src={logo} alt="Logo" />
            </Col>
            <Col sm={2} xs={2} className="text-align-right">
                <Icon iconName="phone" />
                <div>Call Us</div>
            </Col>
        </Row>
    )
}
